import { useSelector } from "react-redux";

const DigimonList = () => {
  const { digimons } = useSelector((state) => state);
  console.log(digimons);
  return (
    <div>
      <ul>
        {digimons.map((digimon, index,level) => {
          return <li key={index}>{digimon} {level}</li>;
        })}
      </ul>
    </div>
  );
};

export default DigimonList;
